const jwt = require('jsonwebtoken');


const generarJWT = (uid)=>{
    return new Promise((resolve, reject)=>{
        //el payload contedra la informacion del usuario, es este caso el uid

        const payload = {
            uid
        }

        jwt.sign(payload, process.env.JWT_SECRET),{
            expiresIn:'12hs'
        }(err, token=>{
            if(err){
                console.log(err);
                reject('No se puede crear el JWT')
            }
            else{
                resolve(token)
            }
        })
    })
}

module.exports={
    generarJWT
}

